let tabela = [];
let tabelaOrdenada = [];
let hashMap = new Map();

function inicializarDados() {
  tabela = [];
  for (let i = 1; i <= 5000; i++) {
    tabela.push({ id: i, nome: nomesFixos[i - 1] });
  }

  tabelaOrdenada = [...tabela];
  hashMap = new Map();
  tabela.forEach(p => hashMap.set(p.id, p));

  preencherListaVisual();
}

function preencherListaVisual() {
  const ul = document.getElementById("lista-registros");
  ul.innerHTML = "";
  const amostra = tabela.slice(0, 120);
  amostra.forEach(p => {
    const li = document.createElement("li");
    const idSpan = document.createElement("span");
    idSpan.textContent = String(p.id).padStart(4, "0");
    const nomeSpan = document.createElement("span");
    nomeSpan.textContent = p.nome;
    li.appendChild(idSpan);
    li.appendChild(nomeSpan);
    ul.appendChild(li);
  });
}

function buscaSequencial(lista, chave) {
  for (let i = 0; i < lista.length; i++) {
    if (lista[i].id === chave) return lista[i];
  }
  return null;
}

function buscaBinaria(lista, chave) {
  let inicio = 0;
  let fim = lista.length - 1;
  while (inicio <= fim) {
    const meio = Math.floor((inicio + fim) / 2);
    const atual = lista[meio].id;
    if (atual === chave) return lista[meio];
    if (atual < chave) inicio = meio + 1;
    else fim = meio - 1;
  }
  return null;
}

function formatarTempo(ms) {
  return ms.toFixed(3) + " ms";
}

function executarBuscasComId(num) {
  const seqCard = document.getElementById("resultado-seq");
  const binCard = document.getElementById("resultado-bin");
  const hashCard = document.getElementById("resultado-hash");
  [seqCard, binCard, hashCard].forEach(c => c.classList.remove("best"));

  const t1 = performance.now();
  const resSeq = buscaSequencial(tabela, num);
  const t2 = performance.now();

  const t3 = performance.now();
  const resBin = buscaBinaria(tabelaOrdenada, num);
  const t4 = performance.now();

  const t5 = performance.now();
  const resHash = hashMap.get(num) || null;
  const t6 = performance.now();

  const tempoSeq = t2 - t1;
  const tempoBin = t4 - t3;
  const tempoHash = t6 - t5;

  atualizarResultadoCard(seqCard, resSeq, tempoSeq);
  atualizarResultadoCard(binCard, resBin, tempoBin);
  atualizarResultadoCard(hashCard, resHash, tempoHash);

  const tempos = [
    { card: seqCard, tempo: tempoSeq, encontrado: !!resSeq },
    { card: binCard, tempo: tempoBin, encontrado: !!resBin },
    { card: hashCard, tempo: tempoHash, encontrado: !!resHash }
  ].filter(t => t.encontrado);

  if (tempos.length > 0) {
    const maisRapido = tempos.reduce((min, atual) =>
      atual.tempo < min.tempo ? atual : min
    );
    maisRapido.card.classList.add("best");
  }

  const detalhes = document.getElementById("detalhes");
  if (resSeq) {
    detalhes.innerHTML = `
      <h3>Detalhes do resultado</h3>
      <p><strong>Pessoa encontrada:</strong> ID <strong>${resSeq.id}</strong> - ${resSeq.nome}</p>
      <p>Os três métodos acessam o mesmo cadastro fixo; a diferença está apenas na forma de busca e no tempo em milissegundos.</p>
    `;
  } else {
    detalhes.innerHTML = `
      <h3>Detalhes do resultado</h3>
      <p>O ID <strong>${num}</strong> não foi encontrado na tabela.</p>
    `;
  }
}

function atualizarResultadoCard(card, resultado, tempoMs) {
  const statusEl = card.querySelector(".status");
  const timeEl = card.querySelector(".time span");
  if (resultado) {
    statusEl.textContent = "Resultado: encontrado";
    statusEl.style.color = "var(--success)";
  } else {
    statusEl.textContent = "Resultado: não encontrado";
    statusEl.style.color = "var(--danger)";
  }
  timeEl.textContent = formatarTempo(tempoMs);
}

function handleBuscaPorId() {
  const campoId = document.getElementById("campo-id");
  const valor = campoId.value.trim();
  const num = Number(valor);
  if (!Number.isInteger(num) || num < 1 || num > 5000) {
    alert("Digite um ID inteiro entre 1 e 5000.");
    return;
  }
  executarBuscasComId(num);
}

function handleBuscaPorNomeOuId() {
  const campoNome = document.getElementById("campo-nome");
  const valor = campoNome.value.trim();
  if (!valor) {
    alert("Digite um nome completo ou um ID.");
    return;
  }

  let num = null;
  const possivelNumero = Number(valor);
  if (Number.isInteger(possivelNumero) && possivelNumero >= 1 && possivelNumero <= 5000) {
    num = possivelNumero;
  } else {
    const texto = valor.toLowerCase();
    const encontrado = tabela.find(p => p.nome.toLowerCase() === texto);
    if (!encontrado) {
      alert("Nenhuma pessoa encontrada com esse nome (precisa ser igual ao da tabela).");
      return;
    }
    num = encontrado.id;
  }
  executarBuscasComId(num);
}

document.addEventListener("DOMContentLoaded", () => {
  inicializarDados();

  const botaoId = document.getElementById("botao-buscar-id");
  const campoId = document.getElementById("campo-id");
  const botaoNome = document.getElementById("botao-buscar-nome");
  const campoNome = document.getElementById("campo-nome");

  botaoId.addEventListener("click", handleBuscaPorId);
  campoId.addEventListener("keydown", e => {
    if (e.key === "Enter") handleBuscaPorId();
  });

  botaoNome.addEventListener("click", handleBuscaPorNomeOuId);
  campoNome.addEventListener("keydown", e => {
    if (e.key === "Enter") handleBuscaPorNomeOuId();
  });
});
